import React from 'react';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';
import HomePage from "./HomePage";

class App extends React.Component {

  render() {
    return (
      <Router>
        <Route exact path="/" render={()=>{
          <HomePage/>
        }}></Route>
      </Router>
    );
  }

}

export default App;
